n | (n >> 1)

First, the right-shift operator (>>) shifts the bits of n to the right by one position, filling the leftmost bit position with 0. Then, the bitwise OR operator (|) sets to 1 all the odd-position bits of the result, which are the even-position bits of the original number n.

For example, for the number 10 (1010 in binary):

10 | (10 >> 1)  # 1010 | 0101 = 1111

